///// Metodo para obtener las personas que no fueron aprobadas en su validació en campo de hogares existesntes /////////////////////////////////////

function Fnc_ValidacionPersonas(s, e) {


    if (e.visibleIndex != -1) {
        var Cod_PersonaValidar = gridHogar.GetRow(e.visibleIndex).childNodes[2].innerText;
        var int_contador = 0;

        if (Array_Validacion_Personas_No_Aprobadas.length == 0) {
            Array_Validacion_Personas_No_Aprobadas.push(Cod_PersonaValidar);
        }
        else {
            for (var i = 0 ; i < Array_Validacion_Personas_No_Aprobadas.length ; i++) {
                if (Array_Validacion_Personas_No_Aprobadas[i] == Cod_PersonaValidar) {
                    Array_Validacion_Personas_No_Aprobadas.splice(i, 1);
                    int_contador += 1;
                }
            }
            if (int_contador == 0) {
                Array_Validacion_Personas_No_Aprobadas.push(Cod_PersonaValidar);
            }
        }

        if (location.pathname == "/Incorporaciones/Incorporaciones/Hogares_Validar") {
            if (gridHogar.GetVisibleRowsOnPage() == Array_Validacion_Personas_No_Aprobadas.length) {
                Aprobar_Nuevo_Hogar = 0;
                if (ComboCausaExclusion.GetSelectedItem()) {
                    if (ComboCausaExclusion.GetSelectedItem().value == 1) {
                        ComboCausaExclusion.SetValue(null);
                    }
                }
            }
        }
    }
    else {
        if (gridHogar.GetSelectedRowCount() > 0) {
            for (var i = 0; i < gridHogar.GetSelectedRowCount() ; i++) {
                if ($.inArray(gridHogar.GetRow(i).childNodes[2].innerText, Array_Validacion_Personas_No_Aprobadas) == -1) {
                    Array_Validacion_Personas_No_Aprobadas.push(gridHogar.GetRow(i).childNodes[2].innerText)
                }
            }
        } else {
            Array_Validacion_Personas_No_Aprobadas = []
        }

    }

}


///////////////// Funcion que obtiene la informacion de las personas que fueron aprobadas en campo a partir de las personas excluidas en campo /////////////

function Fnc_Obtener_Personas_Validadas() {
    var filas_validadas = gridHogar.GetVisibleRowsOnPage()
    for (var x = 0; x < filas_validadas ; x++) {
        if ($.inArray(gridHogar.GetRow(x).childNodes[2].innerText, Array_Validacion_Personas_No_Aprobadas) == -1) {
            Array_Personas_Validadas.push(gridHogar.GetRow(x).childNodes[2].innerText)
        }

    }

}


