///// funciona que realiza validaciones de los paramentos antes de realizar la generación del grafico estadistico

function Peticion_Chart(tipoCambio, peticion) {

    var Str_departamento = (CbDepto.GetSelectedItem() == null) ? "" : CbDepto.GetSelectedItem().value;
    try {
        var FchIncicio = fchInicio.GetText();
        var FchFinal = fchFinal.GetText();
    } catch (error) {

    }

    var Str_municipio = (MuniCb.GetSelectedItem() == null) ? "" : MuniCb.GetSelectedItem().value;
    var Str_aldea = (AldeasCb.GetSelectedItem() == null) ? "" : AldeasCb.GetSelectedItem().value;
    var Str_caserio = (CaserioCb.GetSelectedItem() == null) ? "" : CaserioCb.GetSelectedItem().value;


    if (Str_departamento != "" || (FchIncicio != "" || FchFinal != "")) {
        try {
            var inicio = new Date(FchIncicio)
            var final = new Date(FchFinal)
            if (FchIncicio != "" && FchFinal != "") {
                if (inicio > final) {
                    alert("Se debe de especificar una fecha de inicio valida")
                    return false
                }
            }
        }
        catch (error) {

        }

        if (peticion == 3) {
            var tipo_lev = (cbTipoLev.GetSelectedItem()) ? cbTipoLev.GetSelectedItem().value : null
            if (tipo_lev == null) {
                alert("debe de selecionar un tipo de levantamiento")
                return false
            }
            var Str_Parametos = { 'departamento': Str_departamento, "municipio": Str_municipio, "aldea": Str_aldea, "caserio": Str_caserio, "str_tipo_chart": tipoCambio, "Str_fecha_Inicio": FchIncicio, "Str_Fecha_final": FchFinal, "int_tipo_lev": tipo_lev }
        } else if (peticion == 4) {
            var tipo_lev = (cbTipoLev.GetSelectedItem()) ? cbTipoLev.GetSelectedItem().value : 0
            var Str_Parametos = { 'str_depto': Str_departamento, "str_muni": Str_municipio, "str_aldeas": Str_aldea, "str_caserio": Str_caserio, "fch_inicio": FchIncicio, "fch_final": FchFinal, "int_tipo_lev": tipo_lev }
        } else if (peticion == 5 || peticion == 7 || peticion == 8) {
            var str_localidad = [
                        Str_departamento,
                        Str_municipio,
                        Str_aldea,
                        Str_caserio
            ];
            var Str_Parametos = { str_localidad: str_localidad, "fch_Inicio": fchInicio.GetFormatedText(), "fch_final": fchFinal.GetFormatedText() }
        }
        else if (peticion == 6) {
            var str_localidad = [
                        Str_departamento,
                        Str_municipio,
                        Str_aldea,
                        Str_caserio
            ];
            Str_Parametos = { str_localidad: str_localidad, "int_tipo": tipoCambio };
        }
        else {
            var Str_Parametos = { 'departamento': Str_departamento, "municipio": Str_municipio, "aldea": Str_aldea, "caserio": Str_caserio, "str_tipo_chart": tipoCambio, "Str_fecha_Inicio": FchIncicio, "Str_Fecha_final": FchFinal }
        }

        switch (peticion) {
            case 1:
                Fnc_GenerarGraficoAjax(Str_Parametos)
                break;
            case 2:
                Fnc_ReporteNuevoHogares(Str_Parametos)
                break;
            case 3:
                fnc_ReporteLevantamientosRealizados(Str_Parametos)
                break;
            case 4:
                Fnc_GenerarReportesDeFSU(Str_Parametos)
                break;
            case 5:
                Fnc_ReporteHogaresSuspendidos(Str_Parametos)
                break;
            case 6:
                Fnc_ReportesHogaresActualizados(Str_Parametos)
                break;
            case 7:
                Fnc_ReporteDetalleLevantamiento(Str_Parametos)
                break;

            case 8:
                Fnc_ReporteHogaresPagados(Str_Parametos)
                break;



        }

    }
    else {
        alert("Tiene que selecionar un departamento o especificar una  fecha");
    }

}

