///// funcion que realiza la descarga del grafico selecionado en el formato selecionado

function Fnc_DescargarGrafico(formato) {
    var canvas = document.createElement("canvas");
    canvas.width = 950;
    canvas.height = 600;
    if ($("#" + WebChart.uniqueID).is(":visible")) {
        var imgChart = document.getElementById(WebChart.uniqueID).getElementsByTagName("img")[0],
                contexto = canvas.getContext("2d");
        contexto.drawImage(imgChart, 0, 0);
    } else {
        var imgChart = document.getElementById(WebChart1.uniqueID).getElementsByTagName("img")[0],
                 contexto = canvas.getContext("2d");
        contexto.drawImage(imgChart, 0, 0);
    }


    var Base69String = canvas.toDataURL()
    if (formato == "pdf") {
        var doc = new jsPDF();
        doc.addImage(Base69String, 'JPEG', 15, 40, 180, 95);
        doc.save("Grafico.pdf")
        return true;
    }
    else if (formato == "png") {
        Base69String = Base69String.replace("data:image/png;base64", "data:image/png;base64");
    }
    else if (formato == "jpeg") {
        Base69String = Base69String.replace("data:image/png;base64", "data:image/jpeg;base64");
    }
    var Save = document.createElement("a")
    Save.href = Base69String;
    Save.download = "Grafico"
    var EventoClick = new MouseEvent("click", {
        "view": window,
        "bubbles": true,
        "cancelable": true
    });
    Save.dispatchEvent(EventoClick);

}

