function Fnc_ValidarDatos(tipo, objeto) {
    if (tipo == 1) {
        if (!objeto.GetText().match("^[A-Z a-z  ñáéíóú ÑÁÉÍÓÚ?,]*$")) {
            objeto.SetText("");
        }
    } else if (tipo == 2) {
        if (!objeto.GetText().match("^[0-9]*$")) {
            objeto.SetText("");
        }
    } else if (tipo == 3) {
        if (!objeto.GetText().match("^[A-Z a-z 0-9 ?,]*$")) {
            objeto.SetText("")
        }
    } else if (tipo == 4) {
        if (!objeto.GetText().match("^[A-Z a-z 0-9\-\?,]*$")) {
            objeto.SetText("")
        }
    }
}

function Fnc_ValidarDatosHTML(tipo, objeto) {
    if (tipo == 1) {
        if (!objeto.value.match("^[A-Z a-z  ñáéíóú ÑÁÉÍÓÚ ?,]*$")) {
            objeto.value = ""
        }
    } else if (tipo == 2) {
        if (!objeto.value.match("^[0-9]*$")) {
            objeto.value = ""
        }
    } else if (tipo == 3) {
        if (!objeto.value.match("^[A-Z a-z 0-9 ?,]*$")) {
            objeto.value = ""
        }
    } else if (tipo == 4) {
        if (!objeto.value.match("^[A-Z a-z 0-9\-\?,]*$")) {
            objeto.value = ""
        }
    }
}


