function fnc_validarInformacionFormatoPersonas() {

    var tabla = document.getElementById("tabla")
    var ocurencias = 0
    var posicion = 0

    for (var i = 1; i < tabla.rows.length; i++) {
        for (var c = 1 ; c <= tabla.rows[i].cells.length; c++) {
            if (c == 1) {
                if (tabla.rows[i].cells[c-1].getElementsByClassName("textbox")[0].value.trim() != "") {                    
                    if (tabla.rows[i].cells[c-1].getElementsByClassName("textbox")[0].value.trim().length != 13) {
                        alert("error;el formato de la identida es incorrecto")
                        fnc_limpiarInformacionPersonas()
                        return false
                    }

                    Array_PersonaFicha[0]=tabla.rows[i].cells[c-1].getElementsByClassName("textbox")[0].value.trim();
                }
            } else if (c > 1 && c < 6) {
                if (tabla.rows[i].cells[c - 1].getElementsByClassName("textbox")[0].value.trim() != "") {
                    Array_PersonaFicha[c - 1]=tabla.rows[i].cells[c - 1].getElementsByClassName("textbox")[0].value.trim();
                } else if (tabla.rows[i].cells[0].getElementsByClassName("textbox")[0].value.trim() != "" && (c==2 || c==4))
                {                    
                    alert("Error; tiene que ingresar el nombre completo de la persona");
                    fnc_limpiarInformacionPersonas()
                    return false;
                }
            }
        }
    }
    return true;
}

