function toTitleCase(str) {
    return str.replace(/\w\S*/g, function (txt) { return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase(); });
}

function getBase64Image(url) {

    var img = new Image();
    img.src = url;
    var canvas = document.createElement("canvas");
    canvas.width = img.width;
    canvas.height = img.height;
    var ctx = canvas.getContext("2d");
    ctx.drawImage(img, 0, 0);
    var dataURL = canvas.toDataURL();

    return dataURL;
    
}



function fnc_selecionarLevantamientosImpresion(s, e) {
    var int_contador = 0
    if (e.visibleIndex != -1) {
        var levantamiento = gidLevantamientosImpresion.GetRow(e.visibleIndex).childNodes[1].innerText
        var municipio = gidLevantamientosImpresion.GetRow(e.visibleIndex).childNodes[3].innerText
        var tipo = gidLevantamientosImpresion.GetRow(e.visibleIndex).childNodes[9].innerText
        var enviado = gidLevantamientosImpresion.GetRow(e.visibleIndex).childNodes[11].innerText;
        if (Array_levantamientos[0].length == 0) {
            Array_levantamientos[0].push(levantamiento)
            Array_levantamientos[1].push(municipio)
            Array_levantamientos[2].push(tipo)
            Array_levantamientos[3].push(enviado)

        }
        else {
            for (var i = 0 ; i < Array_levantamientos[0].length ; i++) {
                if (Array_levantamientos[0][i] == levantamiento) {
                    Array_levantamientos[0].splice(i, 1)
                    Array_levantamientos[1].splice(i, 1)
                    Array_levantamientos[2].splice(i, 1)
                    Array_levantamientos[3].splice(i, 1)
                    int_contador += 1
                }
            }

            if (int_contador == 0) {
                Array_levantamientos[0].push(levantamiento)
                Array_levantamientos[1].push(municipio)
                Array_levantamientos[2].push(tipo)
                Array_levantamientos[3].push(enviado)
            }
        }
    }
    else {
        Array_levantamientos = new Array(4)
        Array_levantamientos[0] = new Array()
        Array_levantamientos[1] = new Array()
        Array_levantamientos[2] = new Array()
        Array_levantamientos[3] = new Array()
    }

}

