function Fnc_RealizarCambiotitular()
{
    /*
        En esta función se realizar una peticion al servidor para poder realizar el cambio de titular 
        el servidor realiza una consulta mediante el DBLINK para verificar que la persona que se ingresa por el usuario existe en la base de datos del RUP
        en caso que no exista se realiza un levantamiento de ficha. 
    */
    if ($("#NuevoTitular").is(":visible")) { // primer se verifica que el formulario donde ingresa la información de la persona no este visible , 
                                            // si este formulario esta visible para el usuario es por que la persona que sera titular del hogar no esta registrado en la base de datos del SIG
        if (Fnc_ValidarDatosCambioTitular()) {
            tipoCambio = ComboTipoCambio.GetSelectedItem().value;
            $.ajax({
                data: {
                    "Hogar": LblNumeroHogar.innerText, "identidad": identidad.GetText(), "Nombre1": Nombre1.GetText(), "Nombre2": Nombre2.GetText(),
                    "Apellido1": Apellido1.GetText(), "Apellido2": Apellido2.GetText(), "fch_Nacimiento": FchNacimiento.GetText(), "sexo": ComboSexo.GetSelectedItem().value, "tipo": tipoCambio,
                    "solicitud": LblSolicitud.innerText
                },
                type: 'Post',
                url: "/Incorporaciones/Incorporaciones/AgregarTitular/",
                success: function (response) {
                    if (JSON.parse(response)[0].Column1 == 0) {
                        alert("Esta Persona no es miembro de hogar; se realizar un levantamiento de una fichas socioeconomica unica");
                        window.location.reload()
                    }
                    else if (JSON.parse(response)[0].Column1 == 1) {
                        alert("El cambio se realizo correctamente")
                        window.location.reload()
                    } else if (JSON.parse(response)[0].Column1 == 2) {
                        if (confirm("Hay diferencia entre el nombre ingresado con el nombre en el RUP; ¿desea registrar de todos modos?")) {
                            $.ajax({
                                data: {
                                    "Hogar": LblNumeroHogar.innerText, "identidad": identidad.GetText(), "Nombre1": Nombre1.GetText(), "Nombre2": Nombre2.GetText(),
                                    "Apellido1": Apellido1.GetText(), "Apellido2": Apellido2.GetText(), "fch_Nacimiento": FchNacimiento.GetText(), "sexo": ComboSexo.GetSelectedItem().value,
                                    "tipo": tipoCambio, "solicitud": LblSolicitud.innerText
                                },
                                type: 'Post',
                                url: "/Incorporaciones/Incorporaciones/RegistrarPersonaTitular/",
                                success: function (response) {
                                    if (response == 1) {
                                        alert("El cambio de titular se realizo correctamente");
                                        window.location.reload()
                                    } else {
                                        alert("Error; No se pudo realizar el cambio de titular")
                                        Nuevo_titular = null
                                    }
                                },
                                datatype: "json"
                            });
                        }
                    } else if (JSON.parse(response)[0].Column1 == 3) {
                        alert("la persona ya es titular del hogar")
                        Nuevo_titular = null
                    }
                },
                datatype: "json"
            });
        }
    } else {
        if (ComboTipoCambio.GetSelectedItem() == null) {
            alert("hay campos vacios");
            return false;
        } else {
            tipoCambio = ComboTipoCambio.GetSelectedItem().value;
        }
        
        if (Nuevo_titular != null) {
            $.ajax({
                data: {
                    "Hogar": LblNumeroHogar.innerText, "NuevoTitular": Nuevo_titular, "tipo": tipoCambio, "solicitud": LblSolicitud.innerText
                },
                type: 'Post',
                url: "/Incorporaciones/Incorporaciones/CambioTitular/",
                success: function (response) {
                    if (response == 1) {
                        alert("El cambio de titular se realizo correctamente");
                        //  Grid_CambioTitular.Refresh();
                        window.location.reload()
                    } else {
                        alert("Error; No se pudo realizar el cambio de titular")
                    }
                },
                datatype: "json"
            });
        } else {
            alert("No se ha especificado un nuevo titular")
        }
            
    }

}

