function fnc_ValidarIdentidadPersonaActualizar() {

    if (EditIdentidad.GetText() != "" || EditTxtTitular.GetValue() == 1) {

        if (EditIdentidad.GetText().length == 13) {

            localidad = EditIdentidad.GetText().substring(0, 4);
            nacimiento = EditIdentidad.GetText().substring(4, 8);
            var año = new Date()
            if (!localidad.match("^[0-9][0-9][0-9][0-9]*$") || localidad.match("^0{2}")) {
                return false;
            } else if (isNaN(nacimiento)) {
                return false;
            } else if ((año.getUTCFullYear() - nacimiento) > 135) {
                return false;
            } else if (isNaN(EditIdentidad.GetText().substring(8, 13))) {
                return false;
            }

        } else {
            return false;
        }

        C = 0;

        for (x = 0 ; x < GridPersonasHogar.GetVisibleRowsOnPage() ; x++) {
            if (GridPersonasHogar.GetRow(x).childNodes[4].innerText.trim() != "") {
                if ((GridPersonasHogar.GetRow(x).childNodes[4].innerText.trim() == EditIdentidad.GetText()) && ((EditPer_Persona.GetText() != GridPersonasHogar.GetRow(x).childNodes[3].innerText.trim()))) {
                    C = C + 1;
                }
            }
        }

        if (C >= 1) {
            return false;
        }
    }

    return true;
}

