function fnc_validar_identidades_no_repetidas()
{

    C = 0;
    for (x = 0 ; x < GridPersonasHogar.GetVisibleRowsOnPage() ; x++) {

        for (y = 0 ; y < GridPersonasHogar.GetVisibleRowsOnPage() ; y++) {
            if (x != y)
            {
                if (GridPersonasHogar.GetRow(x).childNodes[4].innerText.trim() != "") {
                    if (GridPersonasHogar.GetRow(y).childNodes[4].innerText.trim() != "") {
                        if (GridPersonasHogar.GetRow(x).childNodes[4].innerText.trim() == GridPersonasHogar.GetRow(y).childNodes[4].innerText.trim()) {
                            C = C + 1
                        }
                    }
                }
            }
        }
    }
    if (C >= 1) {
        //alert("Error; no se pueden registrar identidades repetidas.")
        $(".warning").hide()
        
        $("body").waitMe("hide")
        $("#Error_text").text("ERROR! no se pueden registrar identidades repetidas.")
        $(".error").show()
        $("#Error_text_H").hide()
        $("#Warning_text_H").hide()
        s.SetText(null)

        return false;
    }

    return true;
}



