function fnc_validar_pre_cambio_titular(s, e) {

    if (EditComboTitular.GetValue() == "Es Titular") {
        if (EditTxtTitular.GetValue() == 1 && !fnc_verificar_existencia_titular_dos(EditPer_Persona.GetValue())) {

            s.SetValue("Es Titular")
            $(".warning").hide()
            $("#Error_text_H").hide()
            $("#Warning_text_H").hide()
            $("#Error_text").text("ERROR! Tiene que escoger a otra persona como el titular del hogar")
            $(".error").show()
        } else {
            if (EditTxtCiclo.GetValue() != 0) {
                if (EditTxtCiclo.GetValue() == null) {
                    if (fnc_CalcularEdad(EditfchNacimiento.GetText()) < 18) {
                        s.SetValue("No Es Titular")
                        $(".warning").hide()
                        $("#Error_text_H").hide()
                        $("#Warning_text_H").hide()
                        $("#Error_text").text("ERROR! Un menor de edad no puede ser titular del hogar")
                        $(".error").show()

                    } else if (isNaN(fnc_CalcularEdad(EditfchNacimiento.GetText()))) {
                        s.SetValue("No Es Titular")
                    }
                } else {
                    s.SetValue("No Es Titular")
                    $(".warning").hide()
                    $("#Error_text_H").hide()
                    $("#Warning_text_H").hide()
                    $("#Error_text").text("ERROR! Un menor de edad no puede ser titular del hogar")
                    $(".error").show()
                }

            }
        }
    } else {
        if (EditTxtTitular.GetValue() == 1 && !fnc_verificar_existencia_titular_dos(EditPer_Persona.GetValue()))
        {
            s.SetValue("Es Titular")
            $(".warning").hide()
            $("#Error_text_H").hide()
            $("#Warning_text_H").hide()
            $("#Error_text").text("ERROR! Tiene que escoger a otra persona como el titular del hogar")
            $(".error").show()
        }
    }

}


